import React from 'react';
import s from './ProfilePicture.moddule.css'


const ProfilePicture = (props) => {
    return (
        <div >
            <div className={s.profilePicture}>
                <img src='https://sun1-88.userapi.com/XQgmlZ5HMAFEgcaw5A8vMXjxJYZa98StwGV51Q/Fl_ADu-pkeM.jpg'/>
            </div>

        </div>
    )
}

export default ProfilePicture;
